import React, { useState } from 'react';
import axios from 'axios';

export default function HotDogPage() {
  const [selectedFile, setSelectedFile] = useState(null);
  const [previewUrl, setPreviewUrl] = useState(null);
  const [result, setResult] = useState(null);

  const handleFileChange = (event) => {
    const file = event.target.files[0];
    setSelectedFile(file);
    setPreviewUrl(URL.createObjectURL(file));
    setResult(null);
  };

  const handleDetectClick = async () => {
    if (!selectedFile) return;

    const formData = new FormData();
    formData.append('image', selectedFile);

    const res = await axios.post('http://localhost:3002/api/detect', formData);
    setResult(res.data.result);
  };

  const predefinedImages = [
    { label: "Hot Dog", src: "/images/hotdog.jpg" },
    { label: "Banana", src: "/images/banana.jpg" },
    { label: "Car", src: "/images/car.jpg" },
    { label: "Elephant", src: "/images/elephant.jpg" },
  ];

  const handlePredefinedClick = (imagePath) => {
    fetch(imagePath).then(res => res.blob()).then(blob => {
      const file = new File([blob], imagePath.split('/').pop(), { type: blob.type });
      setSelectedFile(file);
      setPreviewUrl(URL.createObjectURL(blob));
      setResult(null);
    });
  };

  return (
    <div className="container mx-auto text-center mt-10">
      <h1 className="text-4xl font-bold">HotDog or NotHotDog</h1>
      <input type="file" onChange={handleFileChange} className="my-4" />

      {previewUrl && (
        <div className="my-4">
          <img src={previewUrl} alt="Preview" className="mx-auto w-[400px] h-[400px] object-cover" />
          <button onClick={handleDetectClick} className="mt-4 bg-green-500 text-white py-2 px-4 rounded">Detect</button>
        </div>
      )}

      {result && (
        <div className="text-3xl font-bold mt-4">
          {result === "Hot Dog" ? <div className="text-green-500">✔️ Hot Dog!!!</div> : <div className="text-red-500">❌ Not Hot Dog!</div>}
        </div>
      )}

      <div className="flex justify-center gap-4 mt-6">
        {predefinedImages.map(img => (
          <img key={img.label} src={img.src} alt={img.label} className="w-20 h-20 object-cover cursor-pointer" onClick={() => handlePredefinedClick(img.src)} />
        ))}
      </div>
    </div>
  );
}
